   	const { handleSubmit } = this.props;
   return(
    
<div class="main-containe">
  <div class="header">
  
</div>
 
  
  
  
  
  
  
  <div class="form-container">
  <div class="logo-pic">
  </div>
  <h4 class="h3h"> انشاء حساب جديد  </h4>
<form onSubmit={handleSubmit(this.onSubmit)}> 
 
 
<fieldset>
  <Field 
type="text"
name="name" 
id="name" 
class="input-text"
placeholder="الاسم الثلاثي"
component={ InputForm }
/>
</fieldset>

<fieldset>
  <Field 
type="text"
name="username" 
id="username" 
class="input-text"
placeholder="اختر اسم المستخدم "
component={ InputForm }
/>
</fieldset>
 
 
 
<fieldset>
  <Field 
type="text"
name="email" 
id="email" 
class="input-text"
placeholder="الايميل - البريد الالكترونى "
component={ InputForm }
/>
</fieldset>
 
 
 
<fieldset>
  <Field 
type="tel"
name="phone" 
id="phone" 
class="input-text"
placeholder="رقم الهاتف"
component={ InputForm }
/>
</fieldset>
 
 
<fieldset>
  <Field 
type="password"
name="password" 
id="password" 
class="input-text"
placeholder="اكتب الرقم السري"
component={ InputForm }
/>
</fieldset>
 
<fieldset>
  <Field 
type="password"
name="repassword" 
id="repassword" 
class="input-text"
placeholder="أعد كتابة الرقم السري" 
component={ InputForm }
/>
</fieldset>
 

 
 
<button type="submit" class="btn btn-primary shadow w50px grad">تسجيل</button>
  </form>


<h5 > أو تسجيل الدخول عن طريق حسابك فيسبوك أو جوجل</h5>
 <FacebookLogin
              appId=""
              textButton="Facebook"
              fields="name,email,picture"
              callback={this.responseFacebook}
              
              
            />
            <GoogleLogin 
              clientId="746252017489-f5c1v2vlrlhum6vrl2epec0t74qccbvi.apps.googleusercontent.com"
              buttonText="Google"
              onSuccess={this.responseGoogle}
              onFailure={this.responseGoogle}
              
            />
<div class="social-icons">
<img src={FacebookIcon}  class="fbicon"
height="50"
width="50"
/>
<img src={Googleicon}  class="gicon"
height="50"
width="50"
/>
 
 
 
 
</div>
 

 
 
</div>
 
</div>
 
 
 
 
     );
    } 
}
 
const mapStateToProps = state => {
  return {
    errorMsg: state.userAuth.error
  }
  
}
 
export default compose(
  connect(mapStateToProps, actions),
  reduxForm({ form: 'signup' })
)(signUp)
